import React, { Component } from 'react'
import 'bootstrap/dist/css/bootstrap.css'

export default class List extends Component {
  render() {
    return (
      <div>
        <div className='btn btn-primary'>list-a</div>
        <div className='btn btn-primary'>list-b</div>
        <div className='btn btn-primary'>list-c</div>
      </div>
    )
  }
}
